import React from "react";
import { PROJECTS } from "./projects";

const Project = ({ project }) => {
  const selectedProject = PROJECTS.find((p) => p.name === project.name);
  return (
    <div>
      <div className="flex flex-col gap-3 responsive-text not-fancy-font">
        <a target="_blank" href={selectedProject.link}  className="text-30">{selectedProject.name}</a>
        <div className="text-20">{selectedProject.description}</div>
        <div className="text-20">{selectedProject.technologies}</div>
        {/* <div className="text-20">{selectedProject.link} </div> */}
      </div>
    </div>
  );

};

export default Project;
